// code for partial rank correlation
// 4/23/13

double hinge(double x)
{      // max(0, 1-x)
   double value;
   if(x < 1) value = 1 - x; 
   else      value = 0;
   return value; 
}



double pr(double *y, double *x, double *beta, double *corr, int *delta, int *param)
{
    int i, j, k;  
    int n=param[0], p=param[1];
    double sum=0, c, d;
    
    for (i=0; i<n; i++) 
    {
         for (j=0; j<n; j++)  
		 {   
		      if (j != i) 
		      {
      			 c=0;
			     d=0;
			     for (k=0; k<p; k++) 
			     {
			       c = c + x[i*p + k]* beta[k];
			       d = d + x[j*p + k] * beta[k];
		         }
		         sum =  sum + 1.0*delta[j] * (y[i]>y[j]) * (c>d);
   	    	  }
              
		 }
    }
    corr[0] = sum;
    
    return 0; 	 
}

double hpr(double *y, double *x, double *beta, double *corr, int *delta, int *param)
{
    int i, j, k;  
    int n=param[0], p=param[1];
    double sum=0, c, d;
    
    for (i=0; i<n; i++) 
    {
         for (j=0; j<n; j++)  
		 {   
		      if (j != i) 
		      {
      			 c=0;
			     d=0;
			     for (k=0; k<p; k++) 
			     {
			       c = c + x[i*p + k]* beta[k];
			       d = d + x[j*p + k] * beta[k];
		         }
		         sum =  sum + 1.0*delta[j] * (y[i]>y[j]) * hinge(c-d);
   	    	  }
              
		 }
    }
    corr[0] = sum;
    
    return 0; 	 
}

double spr(double *y, double *x, double *beta, double *corr, int *delta, double *sigma, int *param)
{
    int i, j, k; 
	int n=param[0], p=param[1]; 
    double sum=0, Sigma=sigma[0], c, d, u=0;
    
    for (i=0; i<n; i++) 
    {
         for (j=0; j<n; j++)  
		 {    
		      if (j != i) 
		      {
      			 c=0;
			     d=0;
			     for (k=0; k<p; k++) 
			     {
			       c = c + x[i*p + k]* beta[k];
			       d = d + x[j*p + k] * beta[k];
		         }
                 u = (c-d)/Sigma;
		         sum =  sum + 1.0*delta[j]* (y[i]>y[j]) / (1 + exp(-1.0*u));	 
      		   }
              
		 }
    }
    corr[0] = sum; 	 
}


double dspr(double *y, double *x, double *beta, double *der, int *delta, double *sigma, int *param)
{
	int i, j, k, l;
	int n=param[0], p=param[1]; 
    double  Sigma=sigma[0], a0, c, d, u=0, v[param[1]];    
    
    for (i=0; i<n; i++) 
    {
        for (j=0; j<n; j++)  
        { 
        
             if (j != i)
             {
                 c=0;
                 d=0;
			     for (l=0; l<p; l++) 
		     	 {
                     c = c + x[i*p + l]* beta[l];
			         d = d + x[j*p + l] * beta[l];
		         }
                 u =  (c - d)/Sigma;
              
                 for (k=0; k<p; k++)
                 v[k] =  (x[i*p + k] - x[j*p + k])/Sigma;
		      
		         if (u < -500) a0=0;
                 else a0 = exp(-1.0*u)/pow(1.0 + exp(-1.0*u),2.0);
             
                 for (k=0; k<p; k++)
                     der[k] = der[k] + 1.0*delta[j] * (y[i] > y[j]) * a0 * (v[k]);

             }
         }
    }
     
    return 0;	
}


